#include <iostream>
#include <cstring>

using namespace std;

void spacesFront1(char *tab, size_t length)
{	
	for(size_t j=0; j<length-1; j++)
		for(size_t i=length-1; i>j; i--)
			if(tab[i] == ' ')
				swap(tab[i],tab[i-1]);	
}

void spacesFront2(char *tab, size_t length)
{
	int n = length - 1;
	int spaces = length - 1;

   for( int i=n; i>=0; i-- )
   {
   	if(tab[i] != ' ')
      tab[spaces--] = tab[i];
   }
     
   while( spaces >= 0 )
   	tab[spaces--] = ' ';
}



